                                        <h4>{appt.apointdate}</h4>
                                        <h4>{appt.slot}</h4>
                                        <h4>{appt.symptoms}</h4>
                                        <hr/> <hr/> 
                                    </div>);
                        })
                    }
                </center>
            </div>
    </>);
}

export default PatAppt;
